import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="home">
      <header className="home-header">
        <h1>PLEAD â€“ Payments & Legal Enforcement for Agreements & Deals</h1>
        <nav>
          <ul>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/review">Review Contracts</Link></li>
            <li><Link to="/legal-counsel">Legal Counsel</Link></li>
            <li><Link to="/payment">Payment</Link></li>
            <li><Link to="/help">Help</Link></li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default Home;
